import React from "react";
import { NavLink } from "react-router-dom";
const NavBar = ()=>{
    return (
        <div className="nav">
            <h2>Personal Portfolio</h2>
            <ul>
                <li>Home</li>
                <li>About</li>
                <li>Contact Us</li>
            </ul>
            <NavLink> Home </NavLink>
        </div>
    
    )
};

export default NavBar;
